    29→// handleGeminiSessionEnd handles the SessionEnd hook for Gemini CLI.
    30→// This fires when the user explicitly exits the session (via "exit" or "logout" commands).
    31→// Note: The primary checkpoint creation happens in AfterAgent (equivalent to Claude's Stop).
    32→// SessionEnd serves as a cleanup/fallback - it will commit any uncommitted changes that
    33→// weren't captured by AfterAgent (e.g., if the user exits mid-response).
    34→func handleGeminiSessionEnd() error {
    35→	// Set up logging context
    36→	ag, err := GetCurrentHookAgent()
    37→	if err != nil {
    38→		return fmt.Errorf("failed to get agent: %w", err)
    39→	}
    40→	logCtx := logging.WithAgent(logging.WithComponent(context.Background(), "hooks"), ag.Name())
    41→
    42→	// Commit any uncommitted changes (consumes stdin)
    43→	if err := commitWithMetadataGemini(); err != nil {
    44→		fmt.Fprintf(os.Stderr, "Warning: failed to commit metadata: %v\n", err)
    45→	}
    46→
    47→	// Mark session as ended (use persisted session ID since stdin consumed)
    48→	entireSessionID, err := paths.ReadCurrentSession()
    49→	if err != nil {
    50→		fmt.Fprintf(os.Stderr, "Warning: failed to read current session: %v\n", err)
    51→	}
    52→	if entireSessionID != "" {
    53→		logging.Info(logCtx, "session-end-mark",
    54→			slog.String("hook", "session-end"),
    55→			slog.String("hook_type", "agent"),
    56→			slog.String("entire_session_id", entireSessionID),
    57→		)
    58→
    59→		if err := markSessionEnded(entireSessionID); err != nil {
    60→			fmt.Fprintf(os.Stderr, "Warning: failed to mark session ended: %v\n", err)
    61→		}
    62→	}
    63→
    64→	return nil
    65→}
