    80→// parseGeminiSessionEnd parses the session-end hook input and validates transcript.
    81→func parseGeminiSessionEnd() (*geminiSessionContext, error) {
    82→	ag, err := GetCurrentHookAgent()
    83→	if err != nil {
    84→		return nil, fmt.Errorf("failed to get agent: %w", err)
    85→	}
    86→
    87→	input, err := ag.ParseHookInput(agent.HookSessionEnd, os.Stdin)
    88→	if err != nil {
    89→		return nil, fmt.Errorf("failed to parse hook input: %w", err)
    90→	}
    91→
    92→	logCtx := logging.WithAgent(logging.WithComponent(context.Background(), "hooks"), ag.Name())
    93→	logging.Info(logCtx, "session-end",
    94→		slog.String("hook", "session-end"),
    95→		slog.String("hook_type", "agent"),
    96→		slog.String("model_session_id", input.SessionID),
    97→		slog.String("transcript_path", input.SessionRef),
    98→	)
    99→
   100→	sessionID := input.SessionID
   101→	if sessionID == "" {
   102→		sessionID = unknownSessionID
   103→	}
   104→
   105→	transcriptPath := input.SessionRef
   106→	if transcriptPath == "" || !fileExists(transcriptPath) {
   107→		return nil, fmt.Errorf("transcript file not found or empty: %s", transcriptPath)
   108→	}
   109→
   110→	return &geminiSessionContext{
   111→		sessionID:      sessionID,
   112→		transcriptPath: transcriptPath,
   113→	}, nil
   114→}
