   116→// setupGeminiSessionDir creates session directory and copies transcript.
   117→func setupGeminiSessionDir(ctx *geminiSessionContext) error {
   118→	ctx.sessionDir = paths.SessionMetadataDirFromSessionID(ctx.sessionID)
   119→	sessionDirAbs, err := paths.AbsPath(ctx.sessionDir)
   120→	if err != nil {
