   123→	ctx.sessionDirAbs = sessionDirAbs
   124→
   125→	if err := os.MkdirAll(sessionDirAbs, 0o750); err != nil {
   126→		return fmt.Errorf("failed to create session directory: %w", err)
   127→	}
   128→
   129→	logFile := filepath.Join(sessionDirAbs, paths.TranscriptFileName)
   130→	if err := copyFile(ctx.transcriptPath, logFile); err != nil {
