   144→// extractGeminiMetadata extracts prompts, summary, and modified files from transcript.
   145→func extractGeminiMetadata(ctx *geminiSessionContext) error {
   146→	allPrompts, err := geminicli.ExtractAllUserPrompts(ctx.transcriptData)
   147→	if err != nil {
   148→		fmt.Fprintf(os.Stderr, "Warning: failed to extract prompts: %v\n", err)
   149→	}
   150→	ctx.allPrompts = allPrompts
   151→
   152→	promptFile := filepath.Join(ctx.sessionDirAbs, paths.PromptFileName)
   153→	promptContent := strings.Join(allPrompts, "\n\n---\n\n")
   154→	if err := os.WriteFile(promptFile, []byte(promptContent), 0o600); err != nil {
   155→		return fmt.Errorf("failed to write prompt file: %w", err)
   156→	}
   157→	fmt.Fprintf(os.Stderr, "Extracted %d prompt(s) to: %s\n", len(allPrompts), ctx.sessionDir+"/"+paths.PromptFileName)
   158→
   159→	summary, err := geminicli.ExtractLastAssistantMessage(ctx.transcriptData)
   160→	if err != nil {
   161→		fmt.Fprintf(os.Stderr, "Warning: failed to extract summary: %v\n", err)
   162→	}
   163→	ctx.summary = summary
   164→
   165→	summaryFile := filepath.Join(ctx.sessionDirAbs, paths.SummaryFileName)
   166→	if err := os.WriteFile(summaryFile, []byte(summary), 0o600); err != nil {
   167→		return fmt.Errorf("failed to write summary file: %w", err)
   168→	}
   169→	fmt.Fprintf(os.Stderr, "Extracted summary to: %s\n", ctx.sessionDir+"/"+paths.SummaryFileName)
   170→
   171→	modifiedFiles, err := geminicli.ExtractModifiedFiles(ctx.transcriptData)
   172→	if err != nil {
   173→		fmt.Fprintf(os.Stderr, "Warning: failed to extract modified files: %v\n", err)
   174→	}
   175→	ctx.modifiedFiles = modifiedFiles
   176→
   177→	lastPrompt := ""
   178→	if len(allPrompts) > 0 {
   179→		lastPrompt = allPrompts[len(allPrompts)-1]
   180→	}
   181→	ctx.commitMessage = generateCommitMessage(lastPrompt)
   182→	fmt.Fprintf(os.Stderr, "Using commit message: %s\n", ctx.commitMessage)
   183→
   184→	return nil
   185→}
