   187→// commitGeminiSession commits the session changes using the strategy.
   188→func commitGeminiSession(ctx *geminiSessionContext) error {
   189→	repoRoot, err := paths.RepoRoot()
   190→	if err != nil {
   191→		return fmt.Errorf("failed to get repo root: %w", err)
   192→	}
   193→
   194→	preState, err := LoadPrePromptState(ctx.sessionID)
   195→	if err != nil {
   196→		fmt.Fprintf(os.Stderr, "Warning: failed to load pre-prompt state: %v\n", err)
   197→	}
   198→	if preState != nil {
   199→		fmt.Fprintf(os.Stderr, "Loaded pre-prompt state: %d pre-existing untracked files, start message index: %d\n", len(preState.UntrackedFiles), preState.StartMessageIndex)
   200→	}
   201→
   202→	// Get transcript position from pre-prompt state
   203→	var startMessageIndex int
   204→	if preState != nil {
   205→		startMessageIndex = preState.StartMessageIndex
   206→	}
   207→
   208→	// Calculate token usage for this prompt/response cycle (Gemini-specific)
   209→	var tokenUsage *agent.TokenUsage
   210→	if ctx.transcriptPath != "" {
   211→		usage, tokenErr := geminicli.CalculateTokenUsageFromFile(ctx.transcriptPath, startMessageIndex)
   212→		if tokenErr != nil {
   213→			fmt.Fprintf(os.Stderr, "Warning: failed to calculate token usage: %v\n", tokenErr)
   214→		} else if usage != nil && usage.APICallCount > 0 {
   215→			tokenUsage = usage
   216→			fmt.Fprintf(os.Stderr, "Token usage for this checkpoint: input=%d, output=%d, cache_read=%d, api_calls=%d\n",
   217→				tokenUsage.InputTokens, tokenUsage.OutputTokens, tokenUsage.CacheReadTokens, tokenUsage.APICallCount)
   218→		}
   219→	}
   220→
   221→	// Compute new and deleted files (single git status call)
   222→	newFiles, deletedFiles, err := ComputeFileChanges(preState)
   223→	if err != nil {
   224→		fmt.Fprintf(os.Stderr, "Warning: failed to compute file changes: %v\n", err)
   225→	}
   226→
   227→	relModifiedFiles := FilterAndNormalizePaths(ctx.modifiedFiles, repoRoot)
   228→	relNewFiles := FilterAndNormalizePaths(newFiles, repoRoot)
   229→	relDeletedFiles := FilterAndNormalizePaths(deletedFiles, repoRoot)
   230→
   231→	totalChanges := len(relModifiedFiles) + len(relNewFiles) + len(relDeletedFiles)
   232→	if totalChanges == 0 {
   233→		fmt.Fprintf(os.Stderr, "No files were modified during this session\n")
   234→		fmt.Fprintf(os.Stderr, "Skipping commit\n")
   235→		if cleanupErr := CleanupPrePromptState(ctx.sessionID); cleanupErr != nil {
   236→			fmt.Fprintf(os.Stderr, "Warning: failed to cleanup pre-prompt state: %v\n", cleanupErr)
   237→		}
   238→		return nil
   239→	}
   240→
   241→	logFileChanges(relModifiedFiles, relNewFiles, relDeletedFiles)
   242→
   243→	contextFile := filepath.Join(ctx.sessionDirAbs, paths.ContextFileName)
   244→	if err := createContextFileForGemini(contextFile, ctx.commitMessage, ctx.sessionID, ctx.allPrompts, ctx.summary); err != nil {
   245→		return fmt.Errorf("failed to create context file: %w", err)
   246→	}
   247→	fmt.Fprintf(os.Stderr, "Created context file: %s\n", ctx.sessionDir+"/"+paths.ContextFileName)
   248→
   249→	author, err := GetGitAuthor()
   250→	if err != nil {
   251→		return fmt.Errorf("failed to get git author: %w", err)
   252→	}
   253→
   254→	strat := GetStrategy()
   255→	if err := strat.EnsureSetup(); err != nil {
   256→		fmt.Fprintf(os.Stderr, "Warning: failed to ensure strategy setup: %v\n", err)
   257→	}
   258→
   259→	// Get agent type from the hook agent (determined by which hook command is running)
   260→	// This is authoritative - if we're in "entire hooks gemini session-end", it's Gemini CLI
   261→	hookAgent, agentErr := GetCurrentHookAgent()
   262→	if agentErr != nil {
   263→		return fmt.Errorf("failed to get agent: %w", agentErr)
   264→	}
   265→	agentType := hookAgent.Type()
   266→
   267→	// Get transcript identifier at start from pre-prompt state
   268→	var transcriptIdentifierAtStart string
   269→	if preState != nil {
   270→		transcriptIdentifierAtStart = preState.LastTranscriptIdentifier
   271→	}
   272→
   273→	saveCtx := strategy.SaveContext{
   274→		SessionID:                   ctx.sessionID,
   275→		ModifiedFiles:               relModifiedFiles,
   276→		NewFiles:                    relNewFiles,
   277→		DeletedFiles:                relDeletedFiles,
   278→		MetadataDir:                 ctx.sessionDir,
   279→		MetadataDirAbs:              ctx.sessionDirAbs,
   280→		CommitMessage:               ctx.commitMessage,
   281→		TranscriptPath:              ctx.transcriptPath,
   282→		AuthorName:                  author.Name,
   283→		AuthorEmail:                 author.Email,
   284→		AgentType:                   agentType,
   285→		TranscriptLinesAtStart:      startMessageIndex,
   286→		TranscriptIdentifierAtStart: transcriptIdentifierAtStart,
   287→		TokenUsage:                  tokenUsage,
   288→	}
   289→
   290→	if err := strat.SaveChanges(saveCtx); err != nil {
   291→		return fmt.Errorf("failed to save session: %w", err)
   292→	}
   293→
   294→	if cleanupErr := CleanupPrePromptState(ctx.sessionID); cleanupErr != nil {
   295→		fmt.Fprintf(os.Stderr, "Warning: failed to cleanup pre-prompt state: %v\n", cleanupErr)
   296→	}
   297→
   298→	fmt.Fprintf(os.Stderr, "Session saved successfully\n")
   299→	return nil
   300→}
