   302→// logFileChanges logs the modified, new, and deleted files to stderr.
   303→func logFileChanges(modified, newFiles, deleted []string) {
   304→	fmt.Fprintf(os.Stderr, "Files modified during session (%d):\n", len(modified))
   305→	for _, file := range modified {
   306→		fmt.Fprintf(os.Stderr, "  - %s\n", file)
   307→	}
   308→	if len(newFiles) > 0 {
   309→		fmt.Fprintf(os.Stderr, "New files created (%d):\n", len(newFiles))
   310→		for _, file := range newFiles {
   311→			fmt.Fprintf(os.Stderr, "  - %s\n", file)
   312→		}
   313→	}
   314→	if len(deleted) > 0 {
   315→		fmt.Fprintf(os.Stderr, "Files deleted (%d):\n", len(deleted))
   316→		for _, file := range deleted {
   317→			fmt.Fprintf(os.Stderr, "  - %s\n", file)
   318→		}
   319→	}
   320→}
