   322→// commitWithMetadataGemini commits the Gemini session changes with metadata.
   323→// This is a Gemini-specific version that parses JSON transcripts correctly.
   324→func commitWithMetadataGemini() error {
   325→	if skip, branchName := ShouldSkipOnDefaultBranchForStrategy(); skip {
   326→		fmt.Fprintf(os.Stderr, "Entire: skipping on branch '%s' - create a feature branch to use Entire tracking\n", branchName)
   327→		return nil
   328→	}
   329→
   330→	ctx, err := parseGeminiSessionEnd()
   331→	if err != nil {
   332→		if errors.Is(err, ErrSessionSkipped) {
   333→			return nil // Skip signaled
   334→		}
   335→		return err
   336→	}
   337→
   338→	if err := setupGeminiSessionDir(ctx); err != nil {
   339→		return err
   340→	}
   341→
   342→	if err := extractGeminiMetadata(ctx); err != nil {
   343→		return err
   344→	}
   345→
   346→	return commitGeminiSession(ctx)
   347→}
