   349→// createContextFileForGemini creates a context.md file for Gemini sessions.
   350→func createContextFileForGemini(contextFile, commitMessage, sessionID string, prompts []string, summary string) error {
   351→	var sb strings.Builder
   352→
   353→	sb.WriteString("# Session Context\n\n")
   354→	sb.WriteString(fmt.Sprintf("Session ID: %s\n", sessionID))
   355→	sb.WriteString(fmt.Sprintf("Commit Message: %s\n\n", commitMessage))
   356→
   357→	if len(prompts) > 0 {
   358→		sb.WriteString("## Prompts\n\n")
   359→		for i, p := range prompts {
   360→			sb.WriteString(fmt.Sprintf("### Prompt %d\n\n%s\n\n", i+1, p))
   361→		}
   362→	}
   363→
   364→	if summary != "" {
   365→		sb.WriteString("## Summary\n\n")
   366→		sb.WriteString(summary)
   367→		sb.WriteString("\n")
   368→	}
   369→
   370→	if err := os.WriteFile(contextFile, []byte(sb.String()), 0o600); err != nil {
   371→		return fmt.Errorf("failed to write context file: %w", err)
   372→	}
   373→	return nil
   374→}
