   432→// handleGeminiBeforeAgent handles the BeforeAgent hook for Gemini CLI.
   433→// This is equivalent to Claude Code's UserPromptSubmit - it fires when the user submits a prompt.
   434→// We capture the initial state here so we can track what files were modified during the session.
   435→// It also checks for concurrent sessions and blocks if another session has uncommitted changes.
   436→func handleGeminiBeforeAgent() error {
   437→	// Always use the Gemini agent for Gemini hooks (don't use GetAgent() which may
   438→	// return Claude based on auto-detection in environments like VSCode)
   439→	ag, err := agent.Get("gemini")
   440→	if err != nil {
   441→		return fmt.Errorf("failed to get gemini agent: %w", err)
   442→	}
   443→
   444→	// Parse hook input - BeforeAgent provides user prompt info similar to UserPromptSubmit
   445→	input, err := ag.ParseHookInput(agent.HookUserPromptSubmit, os.Stdin)
   446→	if err != nil {
   447→		return fmt.Errorf("failed to parse hook input: %w", err)
   448→	}
   449→
   450→	logCtx := logging.WithAgent(logging.WithComponent(context.Background(), "hooks"), ag.Name())
   451→
   452→	// Log with prompt if available (Gemini provides the user's prompt in BeforeAgent)
   453→	logArgs := []any{
   454→		slog.String("hook", "before-agent"),
   455→		slog.String("hook_type", "agent"),
   456→		slog.String("model_session_id", input.SessionID),
   457→		slog.String("transcript_path", input.SessionRef),
   458→	}
   459→	if input.UserPrompt != "" {
   460→		// Truncate long prompts for logging
   461→		promptPreview := input.UserPrompt
   462→		if len(promptPreview) > 100 {
   463→			promptPreview = promptPreview[:100] + "..."
   464→		}
   465→		logArgs = append(logArgs, slog.String("prompt_preview", promptPreview))
   466→	}
   467→	logging.Info(logCtx, "gemini-before-agent", logArgs...)
   468→
   469→	if input.SessionID == "" {
   470→		return errors.New("no session_id in input")
   471→	}
   472→
   473→	// Capture pre-prompt state with transcript position (Gemini-specific)
   474→	// This captures both untracked files and the current transcript message count
   475→	// so we can calculate token usage for just this prompt/response cycle
   476→	if err := CaptureGeminiPrePromptState(input.SessionID, input.SessionRef); err != nil {
   477→		return fmt.Errorf("failed to capture pre-prompt state: %w", err)
   478→	}
   479→
   480→	// If strategy implements SessionInitializer, call it to initialize session state
   481→	strat := GetStrategy()
   482→	if initializer, ok := strat.(strategy.SessionInitializer); ok {
   483→		agentType := ag.Type()
   484→		if err := initializer.InitializeSession(input.SessionID, agentType, input.SessionRef); err != nil {
   485→			fmt.Fprintf(os.Stderr, "Warning: failed to initialize session state: %v\n", err)
   486→		}
   487→	}
   488→
   489→	return nil
   490→}
