   492→// handleGeminiAfterAgent handles the AfterAgent hook for Gemini CLI.
   493→// This fires after the agent has finished processing and generated a response.
   494→// This is equivalent to Claude Code's "Stop" hook - it commits the session changes with metadata.
   495→// AfterAgent fires after EVERY user prompt/response cycle, making it the correct place
   496→// for checkpoint creation (not SessionEnd, which only fires on explicit exit).
   497→func handleGeminiAfterAgent() error {
   498→	// Skip on default branch for strategies that don't allow it
   499→	if skip, branchName := ShouldSkipOnDefaultBranchForStrategy(); skip {
   500→		fmt.Fprintf(os.Stderr, "Entire: skipping on branch '%s' - create a feature branch to use Entire tracking\n", branchName)
   501→		return nil
   502→	}
   503→
   504→	// Always use Gemini agent for Gemini hooks
   505→	ag, err := agent.Get("gemini")
   506→	if err != nil {
   507→		return fmt.Errorf("failed to get gemini agent: %w", err)
   508→	}
   509→
