	}

	tree, err := commit.Tree()
	if err != nil {
		return ""
	}

	// Build the path to prompt.txt: .entire/metadata/<session-id>/prompt.txt
	checkpointPath := paths.EntireMetadataDir + "/" + sessionID
	return ReadSessionPromptFromTree(tree, checkpointPath)
}

